      "title":"Spalted Pear Roller Ball (Large) Pen",
      "description":"Ashes to ashes, dust to dust -- decay is part of life, and in the case of wood, it can be a beautiful part. After a tree falls, other organisms begin to break it down. Beetles and worms bore holes in the dead wood, and fungus that grows within a log stain it with the striking dark lines known as &quot;spalting&quot;.\r\n\r\nThis gorgeous piece of pear wood has very dramatic spalting, with bold black squiggly lines that dance around the barrel and cap.\r\n\r\nFor this large screw cap roller ball pen, I&#39;ve hand-turned the pen barrels and matching cap finial from one piece of spalted pear tree wood. The hardware is plated with extremely durable rhodium and has 22k gold (plated) accent on the center band and cap finial. The wood is finished with very long-lasting acrylic polished to a high sheen.\r\n\r\nBe sure to check the photos to see the amazing spalting close up. As with all my pens, these photos are of the actual pen you will receive.\r\n\r\nThis is a very large pen, about 3\/4&quot; longer than most of my pens and considerably thicker. This makes it much more suitable to use at a desk, rather than as a pen for carrying. You will feel the luxury of a substantial pen as you write with it. The cap is NOT postable -- you&#39;ll have to set it aside or hold it while you write, as it does not &quot;post&quot; on the back of the pen.\r\n\r\nIt&#39;s rugged enough for everyday use, and its fine craftsmanship will be the envy of everyone who sees you using it. It makes a great gift, too!\r\n\r\nIt takes a standard rollerball refill that&#39;s made by many different companies and is widely available (the same refill fits almost all modern rollerball pens). Pen comes with a top quality refill (Schmidt or Private Reserve).\r\n\r\n(P1443)",
