      "title":"Custom Handcrafted Pen - Rollerball Pen - Rhodium\/Black Titanium and Afzelia Xylay",
      "description":"The Majestic is a front runner of the family of high quality fountain pens. It measures almost 6 inches long and has a great weight to balance feel.  This pen features a durable Rhodium finish with Black Titanium accents.  The body is encased in a wood called Afzelia Xylay.\r\n\r\nAfzelia Xylay is quite a coveted wood on the market due the highly unique lace pattern that infrequently develops during the trees growth cycle. This deep impression lace pattern is reminiscent of tunnels forged within an ant colony and is instantly recognizable. Heavy blister figuring is also commonly found mixed into this prized pattern. These elusive patterns are further compounded by the extreme three dimensional chatoyance this species exhibits. Color tone ranges between bright tangerine and warmer reddish browns with occasional darker streaks appearing throughout the timber. This wonderful signature figuring combined with a saturated color tone put this timber in a class of its own!   You won&#39;t be disappointed with its character and looks.\r\n\r\nI do all the turning and finishing myself.  This pen is turned to size, sanded through progressively finer grades of abrasive, and then finished in a multi-layer acrylic coating.\r\n\r\nThe finish consists of 7 to 10 coats of durable acrylic, with the final coating polished with micro-mesh abrasives.  The end result is a super hard mirror like finish that enhances the beauty of the wood.\r\n\r\nThe pen body is Rhodium plated with Black Titanium accents.  Black Titanium is considered an extremely durable finish, that will hold its shine and last for years.  The rollerball assembly includes a rhodium-plated pen nib with a premium Schmidt steel cartridge refill with a ceramic point. The finished project is complimented with superb balance, superior writing characteristics and an overall stylish, polished & elegant appearance.\r\n\r\nWe ship this pen with an attractive brown or black leatherette case for protection.\r\n\r\nIf you are interested in additional pictures or information about this pen please let us know.",
