      "description":"Limited time - FREE LEATHER PEN CASE!!!\r\n\r\nWith this pen you have the option to receive either: Rollerball or Fountain Pen!! This enables you to customize a beautiful writing instrument for the method you prefer. \r\n\r\nThis chrome plated pen has a well balanced, hefty feel to it. It combines a satin finished pen cap and an articulating clip to allow the perfect fit in any shirt or satchel pocket. This pen measures 1\/2&quot; x 5 1\/2 &quot;. The metal cap on the Presimo Fountain Pen simply presses on the pen end to post and screws on to the pen nib end to close.\r\n\r\nEach acrylic pen I make is shaped by hand (on a lathe), sanded 8 times with progressively finer grits of sandpaper, buffed and waxed to create a showroom quality finish.\r\n\r\nEvery pen that leaves my studio is crafted with unwavering attention to detail. Any writing utensil you purchase from me is crafted to last a lifetime and comes with my personal lifetime warranty against anything except neglect or abuse. In addition to what you will find listed here, I have an almost limitless supply of beautiful domestic and foreign hardwoods, as well as acrylics and various other materials. Most of these are highly figured and are absolutely stunning. If you don&#39;t see what you are looking for, please ask. I will accommodate any request that I possibly can.\r\nThank you for visiting my listing, Mike",
