      "description":"Handcrafted Wooden Pen made from Stabilized Spalted Maple Dyed Red. This pen has beautiful and durable Chrome Hardware. This wooden Pen comes with a Schmidt 888 Rollerball Cartridge. \r\n\r\n This is an absolutely beautiful pen and will give years of joy and pleasure as you write. The rollerball pen is very smooth.  Spalted Maple is dyed Red and really brings out grain and some curl as well. \r\n\r\nCustom making my pen wood allows me to be more artistic and truly sets my pens apart from the crowd. I take great care and interest in all of the pens that I make. I will regularly cut a blank so it will give the best presentation even though it may not be the most economical cut to make. This lets me present pens that are truly unique.\r\n\r\n\r\nAnniversary Gift\r\nFathers Day\r\nBirthday\r\nChristmas\r\nMens Gift\r\nGraduation\r\nSpecial Occasion\r\nBoss&#39;s Gift\r\nRecognition Gift\r\nWedding Gift\r\nGrooms Gift\r\nJuly 4\r\nIndependence Day\r\n\r\nStock # 373M\r\n\r\nTeamCAC CAPS castteam",
