      "title":"Luxury Handcrafted Rollerball Pen - Cocobolo Wood with Black Titanium Hardware",
      "description":"This luxury wood pen was handcrafted from cocobolo wood and accented with black titanium hardware. With its sleek design, this model was created for ease of access for individuals who prefer slim pens that will fit in a shirt pocket and travel easily. This pen is easy to keep close at hand and makes a great conversation piece.\r\n\r\nThe cocobolo wood was hand-turned on a lathe and sanded up to 12,000 grit, followed by applying several layers of cyanoacrylate and finished by polishing to a high gloss shine.\r\n\r\nCocobolo wood is a tropical hardwood found in Central America. Most of the wood from the Dalbergia retusa tree is a light yellow color, but the heartwood is considered very valuable for its deep, rich brown color and figured grain pattern and is often sought after by artists and craftsmen in wood. Because it is an oily wood, it stands up well to extended handling, making it a great wood to use in pens, gun stocks and musical instruments.\r\n\r\nThis pen features a unique, striped grain pattern with several distinctive colors presenting at different angles and with different lighting. It is accented by black titanium hardware that sets off the rich color of the wood. This pen lets the wood speak for itself, and is a unique keepsake to treasure for years to come. \r\n\r\nThe rollerball tip writes smoothly and easily in black ink, and makes a great display piece in an office setting or a unique gift choice for someone special. Refilling the ink is as easy as dropping in to your local office supply store. Care and refill instructions are included with every purchase.",
